import React from 'react';


class SearchResults extends React.Component{
  constructor(props){
      super(props);
      this.state = {
          searchResults: []
      }
  }

    componentWillMount(){
        fetch('http://hn.algolia.com/api/v1/items/1', {method: 'GET'},)
        .then(res => res.json())
        .then(data => this.setState({searchResults: data}));
    }
    render(){       
        const postResults = this.state.searchResults.map(result => {
           return <div key={result.id}>
                <div>{result.author}</div>
                <div>{result.url}</div>
                <div>{result.text}</div>
                <div>{result.points}</div>
            </div>
        });
        return <div><h1>List</h1></div>
    }
}

export default SearchResults;
